import styled, { css } from 'styled-components';



const buttonsStyles = css`
    display: flex;
    justify-content: space-between;
`;

export const SignInContainer = styled.div`
    width: 380px;
    display: flex;
    flex-direction: column;

    ${titleStyles}
    ${buttonsStyles}
`;

export const TitleContainer = css`
    margin: 10px 0;
`;
